import React from "react";

const Necas = ({ text }) => {
  console.log(text);
  {
    text.Search.map((t) => {
      return <p>{t.Title}</p>;
    });
  }
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
